@test integrate(sinh(c+d*x)^4*(a+b*tanh(c+d*x)^2), x) == :(x*(3//8*a+15//8*b)+-1*b*d^-1*tanh(c+d*x)+-1//8*d^-1*(5a+9b)*cosh(c+d*x)*sinh(c+d*x)+1//4*d^-1*cosh(c+d*x)^3*(a+b)*sinh(c+d*x))
